/**
 * Returns the value at `path` of `v`.
 *
 * Example:
 * ```ts
 * getDeep({a: {b: 1}}, ['a', 'b']) // 1
 * getDeep({a: {b: 1}}, ['a', 'c']) // undefined
 * getDeep({a: {b: 1}}, []) // {a: {b: 1}}
